import React from 'react'
import '../stylesheets/homeSlides.css'


const Slide = (props) => {
    const {image, category_type, about} = props
    return (
        <div className='slide'>
            <img src={props.image} alt='props.name'/>
        </div>
    )
}

export default Slide
